import './styles/logIn.css';
import {Card, Container} from "react-bootstrap";

const LogIn = () => {
    return(
        <div className="LogIn">
            <div className='Form'>
                <Container>
                <Card className='Form-card'>
                    <Card.Title className='Card-title Caption'>
                        <b>Увійти</b>
                    </Card.Title>
                    <Card.Body>

                    </Card.Body>
                </Card>
                </Container>
            </div>
        </div>
    );
}
export default LogIn;
